import React from "react";

const ProductCard = (props) => {
  return (
    <div className="card">
      {/* {props.imageSrc && <img src={props.imageSrc} alt={props.title} />} */}
      <div className="card-body">
        <h2>{props.title}</h2>
        <p>{props.description}</p>
      </div>
    </div>
  );
};

export default ProductCard;
